import React from "react";

const App = () => {
  return (
    <div style={styles.container}>
      {/* Header Section */}
      <header style={styles.header}>
        <h1 style={styles.title}>Pakistan Election Portal</h1>
        <nav style={styles.navbar}>
          <a href="#about" style={styles.navLink}>About</a>
          <a href="#features" style={styles.navLink}>Features</a>
          <a href="#contact" style={styles.navLink}>Contact</a>
        </nav>
      </header>

      {/* Hero Section */}
      <section style={styles.hero}>
        <h2 style={styles.heroTitle}>Transparent & Secure Elections</h2>
        <p style={styles.heroText}>
          Conducting elections with integrity and trust. Your vote matters.
        </p>
        <button style={styles.ctaButton}>Get Started</button>
      </section>
      
      {/* Footer Section */}
      <footer style={styles.footer}>
        <p style={styles.footerText}>Â© 2024 Pakistan Election Portal. All rights reserved.</p>
        <p style={styles.footerText}>Made with care for democracy.</p>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    color: "#1a2b2d",
    backgroundColor: "#ffffff",
    margin: 0,
    padding: 0,
  },
  header: {
    backgroundColor: "#1a2b2d",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px",
  },
  title: {
    color: "#ffffff",
    fontSize: "24px",
    margin: 0,
  },
  navbar: {
    display: "flex",
    gap: "15px",
  },
  navLink: {
    color: "#ffffff",
    textDecoration: "none",
    fontSize: "16px",
  },
  hero: {
    textAlign: "center",
    padding: "100px 20px",
    backgroundColor: "#ffffff",
  },
  heroTitle: {
    fontSize: "36px",
    marginBottom: "20px",
  },
  heroText: {
    fontSize: "18px",
    marginBottom: "30px",
    color: "#1a2b2d",
  },
  ctaButton: {
    padding: "10px 20px",
    fontSize: "18px",
    backgroundColor: "#2a9d8f",
    color: "#ffffff",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  },
  section: {
    padding: "50px 20px",
    textAlign: "center",
    backgroundColor: "#ffffff",
    color: "#1a2b2d",
    borderTop: "1px solid #e0e0e0",
  },
  sectionTitle: {
    fontSize: "28px",
    marginBottom: "20px",
  },
  sectionText: {
    fontSize: "16px",
    marginBottom: "20px",
  },
  featuresList: {
    listStyle: "none",
    padding: 0,
  },
  featureItem: {
    fontSize: "18px",
    marginBottom: "10px",
  },
  footer: {
    backgroundColor: "#1a2b2d",
    textAlign: "center",
    padding: "20px",
    color: "#ffffff",
  },
  footerText: {
    fontSize: "14px",
    margin: "5px 0",
  },
};

export default App;
